column78:
Maxime LACROIX :
Aucune observation sur le calepinage des plafonds rayonnants. 
Remarques placement grilles + trappes : 
Double grille bureaux du 40 Laffitte Nord ;
Pas de grille en plafond déco en palier, ventilo-convecteur allège + grille ;
Pas de trappe en plafond déco en palier.

